import imagen from './img/reyes/rey_sisebuto.png';
import imagen1 from './img/reyes/rey_leogivildo.png';
import imagen2 from './img/reyes/rey_atanagildo.png';
import './App.css';

function App() {
  let nombres = ["Atanagildo","Leogivildo","Sisebuto"];
  return (
    <div className="App">
      <header className="App-header">
        <div className='imagenes'>
         <div className="caja">
            <img src={imagen} alt="sisebuto"/>  
            <div className="nombre">{nombres[0]}</div>
         </div>
         <div className="caja">
            <img src={imagen1} alt="sisebuto"/>  
            <div className="nombre">{nombres[1]}</div>
         </div>
         <div className="caja">
            <img src={imagen2} alt="sisebuto"/>  
            <div className="nombre">{nombres[2]}</div>
         </div>
        </div>
      </header>
    </div>
  );
}
export default App;
